import React,{Component} from 'react'; 

class Weather extends Component{

    render(){
        const style = {
            color: 'white'
        }
        const temperature = this.props.temperature; 
        return (
            <div>
                <p Style={style}>{temperature.temp}</p>
            </div>
        );
    }
}

export default Weather;
